import React, { Component } from 'react'
import './App.css';
import HomePage from '../Home/Home';
import { BrowserRouter, Route, Switch } from 'react-router-dom';


function App() {
  return (
    <Router>
        <Route path='/' component={HomePage} />
    </Router>
  );
}

export default App;
